const ProjectList = (projects) => {
  return(
      projects.map(value => {
        return(
      <div key={value.id}>
      <label>{value.name}</label>
      {/* <p>{project.description}</p>
      <p>{project.tool}</p>  */}
      </div>
  )})
  )
}
export default ProjectList;
